import React, {Fragment} from 'react';
import PropTypes from 'prop-types';
import {graphql} from 'react-apollo';
import gql from 'graphql-tag';

import ContactItem from './ContactItem';

const Contacts = ({data:{contacts, loading}}) => {
    return (
        <Fragment>
            <h1 className="large text-primary">List of contacts</h1>
            {}
        </Fragment>
    );
};

const query = gql`
    {
        contacts {
            name
        }
    }
`;

export default graphql(query)(Contacts);
